-- ----------------------------
-- Table structure for `t_login`
-- ----------------------------
DROP TABLE IF EXISTS `t_login`;
CREATE TABLE `t_login` (
  `tloginid` varchar(36) COLLATE utf8_bin NOT NULL COMMENT 'id',
  `loginname` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '用户登录名',
  `password` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '密码',
  `status` int(1) NOT NULL DEFAULT '1' COMMENT '用户状态 1:可用 0:不可用',
  `username` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '用户姓名',
  `phone` varchar(11) COLLATE utf8_bin DEFAULT NULL,
  `registrationuser` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '注册人',
  `registrationtime` datetime NOT NULL COMMENT '注册人时间',
  `sector` varchar(36) COLLATE utf8_bin NOT NULL,
  PRIMARY KEY (`tloginid`),
  UNIQUE KEY `loginname` (`loginname`),
  KEY `FK_T_LOGIN` (`sector`),
  CONSTRAINT `FK_T_LOGIN_SECTOR` FOREIGN KEY (`sector`) REFERENCES `t_sector` (`tsectorid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='用户表';

