-- ----------------------------
-- Table structure for `t_logintrole`
-- ----------------------------
DROP TABLE IF EXISTS `t_logintrole`;
CREATE TABLE `t_logintrole` (
  `tloginid` varchar(36) COLLATE utf8_bin NOT NULL COMMENT '用户id',
  `troleid` varchar(36) COLLATE utf8_bin NOT NULL COMMENT '角色id',
  `tlogintroleid` varchar(36) COLLATE utf8_bin NOT NULL COMMENT 'id',
  PRIMARY KEY (`tlogintroleid`),
  KEY `tloginid` (`tloginid`),
