  CONSTRAINT `t_logintrole_ibfk_1` FOREIGN KEY (`tloginid`) REFERENCES `t_login` (`tloginid`),
  CONSTRAINT `t_logintrole_ibfk_2` FOREIGN KEY (`troleid`) REFERENCES `t_role` (`troleid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='角色权限关联表';

