DROP TABLE IF EXISTS `t_permission`;
CREATE TABLE `t_permission` (
  `tpermissionid` varchar(36) COLLATE utf8_bin NOT NULL COMMENT '权限id',
  `permissionname` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '权限名',
  `action` int(1) NOT NULL DEFAULT '1' COMMENT '动作,1:页面2:按钮',
  `url` varchar(256) COLLATE utf8_bin NOT NULL COMMENT '动作的URL',
  `openicon` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '打开图标',
  `closeicon` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '关闭图标',
  `parentid` varchar(36) COLLATE utf8_bin NOT NULL COMMENT '父ID',
  `orders` int(2) NOT NULL COMMENT '序号',
  PRIMARY KEY (`tpermissionid`),
  UNIQUE KEY `permissionname` (`permissionname`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='权限表';

