-- ----------------------------
-- View structure for `v_departmenttree`
-- ----------------------------
DROP VIEW IF EXISTS `v_departmenttree`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `v_departmenttree` AS select `t_area`.`code` AS `code`,`t_area`.`name` AS `name`,`t_area`.`parentcode` AS `parentcode` from `t_area` union all select `t_department`.`departmentid` AS `departmentid`,`t_department`.`name` AS `name`,`t_department`.`areacode` AS `areacode` from `t_department` ;

-- ----------------------------
-- View structure for `v_do`
-- ----------------------------
DROP VIEW IF EXISTS `v_do`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `v_do` AS select `a`.`ID_` AS `id_`,`a`.`EXECUTION_ID_` AS `execution_id_`,`a`.`PROC_INST_ID_` AS `proc_inst_id_`,`a`.`NAME_` AS `name_`,`a`.`CREATE_TIME_` AS `create_time_`,`a`.`ASSIGNEE_` AS `user_id_`,`a`.`TASK_DEF_KEY_` AS `task_def_key`,`a`.`PROC_DEF_ID_` AS `proc_def_id_` from (`act_ru_task` `a` left join `act_ru_variable` `c` on(((`c`.`NAME_` = 'operid') and (`c`.`EXECUTION_ID_` = `a`.`EXECUTION_ID_`)))) ;

-- ----------------------------
-- View structure for `v_done`
-- ----------------------------
DROP VIEW IF EXISTS `v_done`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `v_done` AS select `t`.`EXECUTION_ID_` AS `executionid`,`t`.`PROC_INST_ID_` AS `procinstid`,`t`.`ACT_NAME_` AS `actname`,`t`.`ASSIGNEE_` AS `assignee`,`t`.`END_TIME_` AS `endtime` from `act_hi_actinst` `t` where ((`t`.`ASSIGNEE_` is not null) and (`t`.`END_TIME_` is not null)) ;

-- ----------------------------
-- View structure for `v_node`
-- ----------------------------
DROP VIEW IF EXISTS `v_node`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `v_node` AS select `t`.`EXECUTION_ID_` AS `executionid`,`t`.`ACT_NAME_` AS `actname`,`t`.`ASSIGNEE_` AS `assignee`,`a`.`TEXT_` AS `agree`,`b`.`TEXT_` AS `opinion`,`t`.`START_TIME_` AS `starttime`,`t`.`END_TIME_` AS `endtime` from ((`act_hi_actinst` `t` left join `act_hi_varinst` `a` on(((`a`.`EXECUTION_ID_` = `t`.`EXECUTION_ID_`) and (`a`.`NAME_` = concat(`t`.`ACT_ID_`,'Result'))))) left join `act_hi_varinst` `b` on(((`b`.`EXECUTION_ID_` = `t`.`EXECUTION_ID_`) and (`b`.`NAME_` = concat(`t`.`ACT_ID_`,'Opinion'))))) where ((`t`.`ASSIGNEE_` is not null) or (`t`.`ACT_TYPE_` = 'endEvent')) ;

-- ----------------------------
-- View structure for `v_sectortree`
-- ----------------------------
DROP VIEW IF EXISTS `v_sectortree`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `v_sectortree` AS select `t_area`.`code` AS `code`,`t_area`.`name` AS `name`,`t_area`.`parentcode` AS `parentcode` from `t_area` union all select `t_department`.`departmentid` AS `departmentid`,`t_department`.`name` AS `name`,`t_department`.`areacode` AS `areacode` from `t_department` union all select `t_sector`.`tsectorid` AS `tsectorid`,`t_sector`.`tsectorname` AS `tsectorname`,`t_sector`.`tdepartmentid` AS `tdepartmentid` from `t_sector` ;

-- ----------------------------
-- View structure for `v_tdictionary`
-- ----------------------------
DROP VIEW IF EXISTS `v_tdictionary`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_tdictionary` AS select `t`.`type` AS `type`,`t`.`code` AS `code`,`t`.`value` AS `value` from `t_dictionary` `t` union all select 'TROLE' AS `TROLE`,`t`.`troleid` AS `troleid`,`t`.`rolename` AS `rolename` from `t_role` `t` union all select 'TAREA' AS `TROLE`,`t_area`.`code` AS `code`,`t_area`.`name` AS `name` from `t_area` union all select 'TDEPARTMENT' AS `TROLE`,`t_department`.`departmentid` AS `departmentid`,`t_department`.`name` AS `name` from `t_department` union all select 'SECTOR' AS `TROLE`,`t_sector`.`tsectorid` AS `tsectorid`,`t_sector`.`tsectorname` AS `tsectorname` from `t_sector` union all select 'USER' AS `USER`,`b`.`loginname` AS `loginname`,`b`.`username` AS `username` from `t_login` `b` ;

-- ----------------------------
-- Function structure for `currval`
-- ----------------------------
DROP FUNCTION IF EXISTS `currval`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `currval`(seq_name VARCHAR(50)) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN  
  
DECLARE VALUE INTEGER;  
  
SET VALUE = 0;  
  
SELECT current_value INTO VALUE FROM t_sequence WHERE NAME = seq_name;  
  
RETURN VALUE;  
  
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `nextval`
-- ----------------------------
DROP FUNCTION IF EXISTS `nextval`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `nextval`(seq_name VARCHAR(50)) RETURNS int(11)
    DETERMINISTIC
BEGIN  
  
UPDATE t_sequence SET current_value = current_value + increment WHERE NAME = seq_name;  
  
RETURN currval(seq_name);  
  
END
;;
DELIMITER ;
